import CloseSharpIcon from '@material-ui/icons/CloseSharp';

const MenuList = ({handleClose}) => {
  return (
      <>
      <CloseSharpIcon onClick={ handleClose} />
      <div>MenuList</div>
      </>
  )
}

export default MenuList;
